Here's a basic outline of how you can create a Rust app that supports the elevenlabs.io API and reads the contents of the clipboard aloud using TTS:

**Step 1: Set up a new Rust project**

Create a new Rust project using `cargo new` command. This will create a new directory with a `Cargo.toml` file, which is used to manage dependencies.

```bash
cargo new elevenlabs_tts
```

**Step 2: Add dependencies**

In the `Cargo.toml` file, add the following dependencies:

* `reqwest` for making HTTP requests to the elevenlabs.io API
* `serde` for serializing and deserializing JSON data
* `clipboard` for accessing the clipboard contents
* `tts` for text-to-speech functionality (you can use a library like `flite` or `espeak`)

```toml
[dependencies]
reqwest = "0.11.10"
serde = { version = "1.0", features = ["derive"] }
clipboard = "0.5.0"
flite = "0.3.0"
```

**Step 3: Create a struct to hold API credentials**

Create a new file `api_credentials.rs` with the following code:

```rust
use serde::{Serialize, Deserialize};

#[derive(Serialize, Deserialize)]
struct ApiCredentials {
    api_key: String,
    api_secret: String,
}
```

**Step 4: Create a function to make API requests**

Create a new file `api_requests.rs` with the following code:

```rust
use reqwest;
use serde_json::Value;

async fn make_api_request(
    api_credentials: &ApiCredentials,
    endpoint: &str,
    data: serde_json::Value,
) -> Result<serde_json::Value, reqwest::Error> {
    let client = reqwest::Client::new();
    let url = format!("https://api.elevenlabs.io/{}", endpoint);
    let response = client
        .post(url)
        .header("Authorization", format!("Bearer {}", api_credentials.api_key))
        .header("Content-Type", "application/json")
        .body(data.to_string())
        .send()
        .await?;

    let json: serde_json::Value = response.json().await?;
    Ok(json)
}
```

