Here is a step-by-step guide to creating a React, Node, and Express.js web app for creating and adding dummy data:

**Step 1: Create a new React project**

Open your terminal and run the following command to create a new React project:
```
npx create-react-app my-app
```
This will create a new React project called `my-app` in a new directory.

**Step 2: Create a new Node.js project**

Open your terminal and run the following command to create a new Node.js project:
```
mkdir my-app-server
cd my-app-server
npm init -y
```
This will create a new Node.js project called `my-app-server` in a new directory.

**Step 3: Install dependencies**

In the `my-app-server` directory, run the following command to install the required dependencies:
```
npm install express mongoose body-parser cors
```
This will install Express.js, Mongoose, Body-Parser, and CORS.

**Step 4: Create a new Express.js server**

Create a new file called `server.js` in the `my-app-server` directory and add the following code:
```
const express = require('express');
const app = express();
const mongoose = require('mongoose');
const bodyParser = require('body-parser');
const cors = require('cors');

app.use(bodyParser.json());
app.use(cors());

mongoose.connect('mongodb://localhost/my-app', { useNewUrlParser: true, useUnifiedTopology: true });

const db = mongoose.connection;

db.on('error', (err) => {
  console.error(err);
});

db.once('open', () => {
  console.log('Connected to MongoDB');
});

app.get('/api/data', (req, res) => {
  // Add dummy data here
  const data = [
    { id: 1, name: 'John Doe', email: 'john.doe@example.com' },
    { id: 2, name: 'Jane Doe', email: 'jane.doe@example.com' },
  ];
  res.json(data);
});

app.post('/api/data', (req, res) => {
  // Add new data here
  const { name, email } = req.body;
  const data = { id: 3, name, email };
  res.json(data);
});

app.listen(3001, () => {
  console.log('Server started on port 3001');
});
```
This code creates a new Express.js server that listens on port 3001 and connects to a MongoDB database. It also defines two API endpoints: one to retrieve dummy data and another to add new data.

